description:
Be the first to hear South African Die Antwoord carve up some ludicrous lyrical landscapes with their rap rave megamix debut $o$.

All these tracks are freely available online in one form or another and now compiled into one nifty torrent.

Files are MP3 Format and a random 116kbps bitrate, and I guess if you want higher quality you're just going to have wait a bit - the Die Antwoord album will be released for free on the interwebs.
